Let me think through this step by step...

**Key Psychological Mechanisms:**

The key psychological mechanisms at play in this responder task are fairness and self-interest.  Responders will likely consider the fairness of the offer relative to the contributions of both players (captured by `token_self` and `token_opp`) and their own potential gain (`split_self`).  A purely self-interested responder would only consider their own gain, while a completely fairness-focused responder would compare their share to the opponent's share considering the token contributions.  We expect a combination of both.


**How these Mechanisms Interact:**

We can assume a utility function that combines both self-interest and fairness concerns. Self-interest is straightforward – higher proposed amounts for the participant lead to higher utility.  Fairness can be modeled by comparing the ratio of the proposed shares to the ratio of the tokens each participant contributed. The closer this ratio is to 1 (equal proportions), the more fair the offer appears. A deviation from 1 signifies an unfair offer, negatively affecting utility.


**Mathematical Form:**

We can capture this interaction using a utility function that is a weighted sum of self-interest and a fairness term.

**Parameters:**

We'll need two learnable parameters:

1.  `self_interest_weight`: This parameter reflects the relative importance of self-interest compared to fairness considerations.  A higher value indicates a stronger focus on self-interest.
2.  `fairness_sensitivity`: This parameter determines the sensitivity of the responder to perceived unfairness. A higher value signifies that the respondent is more averse to unfair offers.


**How Model Variables Map to Observable Behavior:**

The model will use `token_self`, `token_opp`, and `split_self` and `split_opp` to calculate the fairness term. The utility will be a weighted sum of these. Higher utility will lead to a higher probability of acceptance (although the probability calculation itself is not part of this model).


<MODEL>
utility = self_interest_weight * split_self + fairness_sensitivity * (1 - abs((split_self / split_opp) - (token_self / token_opp)))
</MODEL>

